import {Container,Section} from 'react-bulma-components'

//Utilizar props
const Header = ({tittle}) => {
    return (
        <Section>
            <Container>
                <h1 className="tittle has-text-centered" >{ tittle }</h1>
            </Container>
        </Section>
    )
}

export default Header
